import { useState } from "react";
import axios from "axios";
import { Button, Typography, Container, Box, Card, CardContent, Switch, FormControlLabel } from "@mui/material";

const API_URL = process.env.REACT_APP_API_URL || "http://localhost:5000";

const UploadForm = ({ setToken }) => {
    const [realEstateFile, setRealEstateFile] = useState(null);
    const [techFile, setTechFile] = useState(null);
    const [carFile, setCarFile] = useState(null);
    const [loading, setLoading] = useState(false);
    const [finalResult, setFinalResult] = useState(null);

    // Состояния ползунков
    const [useYolo, setUseYolo] = useState(true);
    const [useTensorFlow, setUseTensorFlow] = useState(true);
    const [useClip, setUseClip] = useState(true);
    const [useResNet, setUseResNet] = useState(true);

    const handleFileChange = (event, type) => {
        if (type === "real_estate") setRealEstateFile(event.target.files[0]);
        if (type === "tech") setTechFile(event.target.files[0]);
        if (type === "car") setCarFile(event.target.files[0]);
    };

    const handleUpload = async () => {
        const formData = new FormData();
        if (realEstateFile) formData.append("files", realEstateFile);
        if (techFile) formData.append("files", techFile);
        if (carFile) formData.append("files", carFile);

        formData.append("types", "real_estate");
        formData.append("types", "tech");
        if (carFile) formData.append("types", "car");

        // Добавляем включенные модели в запрос
        formData.append("useYolo", useYolo);
        formData.append("useTensorFlow", useTensorFlow);
        formData.append("useClip", useClip);
        formData.append("useResNet", useResNet);

        setLoading(true);
        const response = await axios.post(`${API_URL}/predict/`, formData);
        setFinalResult(response.data);
        setLoading(false);
    };

    const handleLogout = () => {
        localStorage.removeItem("token");
        setToken(null);
    };

    return (
        <Container maxWidth="sm">
            <Box textAlign="center" mt={4} p={3} boxShadow={3} borderRadius={2}>
                <Typography variant="h5">Загрузка изображений</Typography>

                {/* Ползунки для включения/отключения моделей */}
                <Box display="flex" flexDirection="column" alignItems="center">
                    <FormControlLabel
                        control={<Switch checked={useYolo} onChange={() => setUseYolo(!useYolo)} />}
                        label="Использовать YOLO"
                    />
                    <FormControlLabel
                        control={<Switch checked={useTensorFlow} onChange={() => setUseTensorFlow(!useTensorFlow)} />}
                        label="Использовать TensorFlow"
                    />
                    <FormControlLabel
                        control={<Switch checked={useClip} onChange={() => setUseClip(!useClip)} />}
                        label="Использовать CLIP"
                    />
                    <FormControlLabel
                        control={<Switch checked={useResNet} onChange={() => setUseResNet(!useResNet)} />}
                        label="Использовать ResNet (авто)"
                    />
                </Box>

                <Typography>🏡 Недвижимость:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "real_estate")} />

                <Typography>📱 Техника:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "tech")} />

                <Typography>🚗 Автомобиль:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "car")} />

                <Button variant="contained" color="primary" onClick={handleUpload} disabled={loading}>
                    {loading ? "Рассчитываем..." : "Рассчитать"}
                </Button>

                {finalResult && (
                    <Card variant="outlined" mt={3}>
                        <CardContent>
                            <Typography variant="h6">📊 Общий класс</Typography>
                            <Typography variant="h4" fontWeight="bold" color="primary">
                                {finalResult.final_class} ({finalResult.final_confidence}%)
                            </Typography>
                        </CardContent>
                    </Card>
                )}

                <Button variant="contained" color="secondary" onClick={handleLogout} style={{ marginTop: "15px" }}>
                    Выйти
                </Button>
            </Box>
        </Container>
    );
};

export default UploadForm;
